        /// <summary>Returns true if less or equal to.</summary>
        public static bool operator <=(Mass left, Mass right)
        {
            return left.Value <= right.GetValueAs(left.Unit);
        }

        /// <summary>Returns true if greater than or equal to.</summary>
        public static bool operator >=(Mass left, Mass right)
        {
            return left.Value >= right.GetValueAs(left.Unit);
        }

        /// <summary>Returns true if less than.</summary>
        public static bool operator <(Mass left, Mass right)
        {
            return left.Value < right.GetValueAs(left.Unit);
        }

        /// <summary>Returns true if greater than.</summary>
        public static bool operator >(Mass left, Mass right)
        {
            return left.Value > right.GetValueAs(left.Unit);
        }

        /// <summary>Returns true if exactly equal.</summary>
        /// <remarks>Consider using <see cref="Equals(Mass, QuantityValue, ComparisonType)"/> for safely comparing floating point values.</remarks>
        public static bool operator ==(Mass left, Mass right)
        {
            return left.Equals(right);
        }
        /// <summary>Returns true if not exactly equal.</summary>
        /// <remarks>Consider using <see cref="Equals(Mass, QuantityValue, ComparisonType)"/> for safely comparing floating point values.</remarks>
        public static bool operator !=(Mass left, Mass right)
        {
            return !(left == right);
        }

        /// <inheritdoc />
        public int CompareTo(object obj)
        {
            if (obj is null) throw new ArgumentNullException(nameof(obj));
            if (!(obj is Mass objMass)) throw new ArgumentException("Expected type Mass.", nameof(obj));

            return CompareTo(objMass);
        }

        /// <inheritdoc />
        public int CompareTo(Mass other)
        {
            var asFirstUnit = other.GetValueAs(this.Unit);
            var asSecondUnit = GetValueAs(other.Unit);
            return (_value.CompareTo(asFirstUnit) - other.Value.CompareTo(asSecondUnit)) / 2;
        }

        /// <inheritdoc />
        /// <remarks>Consider using <see cref="Equals(Mass, QuantityValue, ComparisonType)"/> for safely comparing floating point values.</remarks>
        public override bool Equals(object obj)
        {
            if (obj is null || !(obj is Mass objMass))
                return false;
            return Equals(objMass);
        }

        /// <inheritdoc />
        /// <remarks>Consider using <see cref="Equals(Mass, QuantityValue, ComparisonType)"/> for safely comparing floating point values.</remarks>
        public bool Equals(Mass other)
        {
            if (Value.IsDecimal)
                return other.Value.Equals(this.GetValueAs(other.Unit));
            if (other.Value.IsDecimal)
                return Value.Equals(other.GetValueAs(this.Unit));
            return this.Unit == other.Unit && this.Value.Equals(other.Value);
        }

        /// <summary>
        ///     <para>
        ///     Compare equality to another Mass within the given absolute or relative tolerance.
        ///     </para>
        ///     <para>
        ///     Relative tolerance is defined as the maximum allowable absolute difference between this quantity's value and
        ///     <paramref name="other"/> as a percentage of this quantity's value. <paramref name="other"/> will be converted into
        ///     this quantity's unit for comparison. A relative tolerance of 0.01 means the absolute difference must be within +/- 1% of
        ///     this quantity's value to be considered equal.
        ///     <example>
        ///     In this example, the two quantities will be equal if the value of b is within +/- 1% of a (0.02m or 2cm).
        ///     <code>
        ///     var a = Length.FromMeters(2.0);
        ///     var b = Length.FromInches(50.0);
        ///     a.Equals(b, 0.01, ComparisonType.Relative);
        ///     </code>
        ///     </example>
        ///     </para>
        ///     <para>
        ///     Absolute tolerance is defined as the maximum allowable absolute difference between this quantity's value and
        ///     <paramref name="other"/> as a fixed number in this quantity's unit. <paramref name="other"/> will be converted into
        ///     this quantity's unit for comparison.
        ///     <example>
        ///     In this example, the two quantities will be equal if the value of b is within 0.01 of a (0.01m or 1cm).
        ///     <code>
        ///     var a = Length.FromMeters(2.0);
        ///     var b = Length.FromInches(50.0);
        ///     a.Equals(b, 0.01, ComparisonType.Absolute);
        ///     </code>
        ///     </example>
        ///     </para>
        ///     <para>
